
public class CheckAnswer {

	public static void main(String[] args) {
		String answer = "";
		char[] ans = answer.toCharArray();
		
		for(int i = 0; i < ans.length; i++) {
			if(ans[i] == 'F') {
				ans[i] = '1';
			} else if (ans[i] == 'L') {
				ans[i] = '0';
			}
		}
		
		String ourSol = "";
		
		for(int j = 0; j < ans.length; j++) {
			System.out.print(ans[j]);
		}
		System.out.println();
		
		System.out.println(ourSol);
	}
	
}
